import React from 'react';
import LevelDropdown from './LevelDropdown';
import './ChatroomList.css';

export default function ChatroomList({ level, setLevel, setSelectedRoom }) {
  return (
    <div className="chatroom-list-wrapper">
      <LevelDropdown level={level} setLevel={setLevel} />
      <h2>Chatroomy ({level}):</h2>
      <div className="cards">
        {subject[level].map((subject) => (
          <div
            key={subject}
            className="card"
            onClick={() => setSelectedRoom(subject)}
          >
            {subject}
          </div>
        ))}
      </div>
    </div>
  );
}
